INSERT INTO `pre_mall_agent_revise` VALUES ('1', '1', '养老到家测试机构', '', '', '江苏省宿迁市泗洪县', '118.243703,33.460977', 'data/agent/201707/12/175508ztz4l8f13p3i54lj.jpg', 'data/agent/201707/12/175510t6g7fk9wq66oodqf.jpg', 'data/agent/201707/12/142122sh6xbft7s87p9mb7.jpg', 'data/agent/201708/16/105459erw4krcmcrrmw74r.jpg', 'data/agent/201708/16/105501pug7urkuk7yg0dk6.jpg', 'data/agent/201708/16/105502jn4rerfz4kk4mj42.jpg', 'a:4:{i:0;s:47:\"data/agent/201707/12/142125q0v7g0gqqvbtj8o8.jpg\";i:1;s:47:\"data/agent/201708/24/195940erturr42ortupz8r.jpg\";i:2;s:47:\"data/agent/201708/24/195944sygm4u3rjfufj998.jpg\";i:3;s:47:\"data/agent/201708/24/195946pqw8qd6lllbuw1wy.jpg\";}', 'a:4:{i:0;s:47:\"data/agent/201708/24/200013e5qzfcwujdjzb6yg.jpg\";i:1;s:47:\"data/agent/201708/24/200015inzcn7wnmb6t7cln.jpg\";i:2;s:47:\"data/agent/201708/24/200017yvhrzgra4jwhj999.jpg\";i:3;s:47:\"data/agent/201708/24/200019onhm50hmwpi5snfs.jpg\";}', '北京市平谷区东安仙居老年公寓（峪口镇养老照料中心）是山清水碧、空气清新、花香鸟语、环境优雅的休闲养老胜地。温润舒爽的海洋气候、绿色天然的生态环境、高品质的公寓建筑、人性化的配套设施、细致周密的综合服务将为老年朋友筑就亲近山水、返璞归真、休闲养生的人间圣境、世外桃源！老年公寓已取得北京市平谷区民政局养老机构运营许可，是北京市养老照料中心之一。养老方式主要有：集中供养式、居家休闲式、分时度假式三种，居住环境宽敞舒适。总建筑面积4100平米，容纳154张床位，每间建筑面积30-62平方米，格局统一和谐，房间整洁、廊道宽敞、雍容典雅，高级地热、防滑地砖，安全无障碍。', '养老到家实业家专业的包括（不仅限于）养老,家政为一体的公司，我们本着服务至上的理念，致力于搭建完美的网络平台，努力建立服务与需求之间完整的体系。test', '1', '1503576020');
