INSERT INTO `pre_mall_article` VALUES ('1', '关于我们', '&lt;p&gt;\r\n	&lt;p style=&quot;text-indent:24.0000pt;&quot;&gt;\r\n		&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;关于我们&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;text-indent:24.0000pt;&quot;&gt;\r\n		&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;团家政网，是一家致力于为&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;亿中国家庭提供综合家政服务的网络平台，其显著特点是：&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;text-indent:24.0000pt;&quot;&gt;\r\n		&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;一、全面：每座城市&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;80%&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;以上的家政、保洁、月嫂、维修、家教等服务机构都入驻平台，雇主选择余地大；&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;text-indent:24.0000pt;&quot;&gt;\r\n		&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;二、便捷：随时随地在团家政&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;APP&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;上找到需要的家政服务，在线下单、在线结算、在线点评；&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;text-indent:24.0000pt;&quot;&gt;\r\n		&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;三、质优：我们选择在当地政府、行业组织的评级中，获得优良级以上的家政机构入驻团家政平台；&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;text-indent:24.0000pt;&quot;&gt;\r\n		&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;四、低价：我们联合所有入驻平台的家政机构，为每一名雇主提供团购价服务，折扣率最低&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;20%&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;，高的可达&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;50%&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;以上；&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;text-indent:24.0000pt;&quot;&gt;\r\n		&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;五、安全：团家政网在行业中的最大优势是能对家政从业人员进行实名验证，事先过滤掉有不良记录的从业人员；&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;text-indent:24.0000pt;&quot;&gt;\r\n		&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;六、信誉累积：团家政网的最大亮点是其行业独有的互评系统，雇主、家政机构、从业人员可以通过自己的良好服务、交易行为获得好评，积累信誉。信誉等级高的雇主，可以优先选择高信誉等级家政人员；信誉等级高的家政人员可以提高薪酬，获得价值认同；信誉等级高的机构可以获得当地政府、行业、平台年度奖励。&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:10.5000pt;&quot;&gt;&lt;/span&gt;\r\n	&lt;/p&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;', '1', '1', '1483275093');
INSERT INTO `pre_mall_article` VALUES ('3', '使用声明', '&lt;p align=&quot;center&quot; style=&quot;text-align:center;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-size:10.5pt;font-family:宋体;color:#333333;&quot;&gt; &lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p align=&quot;center&quot; style=&quot;text-indent:22.5000pt;text-align:center;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:14pt;&quot;&gt;&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p align=&quot;center&quot; style=&quot;text-indent:22.5000pt;text-align:center;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:14pt;&quot;&gt;&lt;span&gt;团家政网使用声明&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#646464;font-size:14pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p align=&quot;justify&quot; style=&quot;text-indent:18.0000pt;text-align:justify;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;欢迎您使用团家政网的服务！&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p align=&quot;justify&quot; style=&quot;text-indent:18.0000pt;text-align:justify;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;在您使用团家政网的服务之前，请您详细阅读、理解《团家政网使用声明》的所有内容。&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p align=&quot;justify&quot; style=&quot;text-indent:22.5000pt;text-align:justify;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;一、定义&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;团家政平台，也称团家政网、平台，是指泗洪鹿鹤松网络科技有限公司旗下运营的团家政网站&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9.0000pt;&quot;&gt;（&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;www&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:9pt;&quot;&gt;.Tuanjiazheng.&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;com)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、及团家政网移动应用软件（&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;APP&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;用户，包含注册用户和非注册用户&lt;/span&gt;(以下简称您)。注册用户是指通过我们平台完成全部注册程序后，使用平台服务的用户。非注册用户是指未进行注册、直接登录我们平台或通过其他网站进入我们平台直接或间接地使用我们平台服务的用户。&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:22.5000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;二、声明的效力&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:9pt;&quot;&gt;1&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:9pt;&quot;&gt;&lt;span&gt;、在您按照注册页面提示填写信息并完成全部注册程序后，或以其他我们允许的方式实际使用我们平台服务时，即视同您已详细阅读并接受本声明。&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:9pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:9pt;&quot;&gt;2&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:9pt;&quot;&gt;&lt;span&gt;、本声明的内容包括正文和您在使用团家政网某一特定服务时，该服务可能会另有单独的声明、相关业务规则等（以下统称为&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:9pt;&quot;&gt;“&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:9pt;&quot;&gt;&lt;span&gt;规则&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:9pt;&quot;&gt;”&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:9pt;&quot;&gt;&lt;span&gt;）。所有团家政网已经发布的或将来可能发布的规则为本声明不可分割的组成部分，与本声明具有同等法律效力。除另行明确外，任何团家政网及其关联公司提供的服务（以下称为&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:9pt;&quot;&gt;“&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:9pt;&quot;&gt;&lt;span&gt;团家政平台服务&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:9pt;&quot;&gt;”&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:9pt;&quot;&gt;&lt;span&gt;）均受本声明约束。您承诺接受并遵守本声明的约定。如果您不同意本声明的约定，您应立即停止注册程序或停止使用团家政平台服务，如您继续访问和使用团家政平台服务，即视为您已确知并完全同意本声明的各项内容。&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:9pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;3&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、团家政网有权根据国家法律法规的更新、产品和服务规则的调整需要不时地制订、修改本声明和各类规则，并以网站公示的方式进行公示。如您继续使用团家政平台的服务，即表示您接受经修订的声明和规则。如发生有关争议时，以争议事件发生时团家政网最新的相关声明和规则为准。&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:22.5000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;三、注册&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您确认，在您完成注册程序或以其他团家政网允许的方式实际使用团家政平台服务时，您应当是具备相应民事行为能力的自然人、法人或其他组织。若您不具备前述主体资格，则您及您的家长或法定监护人（以下统称&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;&quot;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;监护人&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;&quot;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）应承担因此而导致的一切后果，且团家政网有权注销您的账户，并向您及您的监护人索偿。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、团家政网非常重视对青少年个人信息搜集和使用的安全性的保护。团家政网建议，任何未满&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;18&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;周岁的未成年人参加网上活动应事先取得其监护人可经查证的同意并遵守《青少年网络文明公约》。监护人应承担未成年人网络活动风险及保护未成年人相关网络隐私的首要责任。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、在您完成注册程序时，团家政网会向您提供唯一编号的团家政网账户。您应对您的用户账户、登录密码、支付密码（如有）、验证码的安全，以及对通过您的账户和密码实施的行为负责；因此所衍生的任何损失或损害，团家政网无法也不承担任何责任。除非有法律规定或行政司法机关的指令，且征得团家政网的同意，否则您的用户账户、登录密码、支付密码（如有）和验证码不得以任何方式转让、借用、赠与或继承（与账户相关的财产权益除外）。否则，由此给您（或团家政网、任何第三方）造成的一切损失，概由您自行承担（或者负责赔偿）。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、如果发现任何人不当使用您的账户或有任何其他可能危及您的账户安全的情形时，您应当立即以有效方式通知团家政网，要求团家政网暂停相关服务。您理解团家政网对您的请求采取行动需要合理时间，团家政网对在采取行动前已经产生的后果（包括但不限于您的任何损失）不承担任何责任。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您在注册帐号或使用团家政平台服务的过程中，需要填写您的真实的身份信息。若您填写的信息不完整，则无法使用团家政平台服务或在使用过程中受到限制。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;6&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您了解并同意，如您符合并且遵守本声明条款，在通过团家政平台完成注册程序之后，即可成为团家政平台用户。对于您主动提交的相关信息，您授权团家政网及团家政网站运营者及关联服务提供方委托的第三方通过合法渠道（包括但不限于征信机构等）了解、咨询、审查您的个人市场交易风险的真实情况，并据此判断您的风险状况。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;7&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您了解并同意，一经注册用户账号，即视为您同意团家政网及其关联公司通过短信或者电子邮件的方式向您注册时填写的手机号码或者电子邮箱发送相应的产品服务、广告信息、促销优惠等营销信息；您如果不同意发送，您可以通过相应的退订功能进行退订。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:22.5000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;四、团家政平台服务使用规范&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、通过团家政平台您可以按照团家政网的规则发布各种家政服务信息，但所发布之信息不得含有如下内容：&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;1)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;反对宪法所确定的基本原则，煽动抗拒、破坏宪法和法律、行政法规实施的；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;煽动危害国家安全、泄露国家秘密、颠覆国家政权，推翻社会主义制度的；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;3)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;煽动分裂国家、破坏国家统一、损害国家荣誉和民族利益的；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;4)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;煽动民族仇恨、民族歧视，破坏民族团结的；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;5)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;捏造或者歪曲事实，散布谣言，扰乱社会秩序的；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;6)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;进行政治宣传或破坏国家宗教政策、宣扬封建迷信、淫秽、色情、赌博、暴力、凶杀、恐怖、教唆犯罪的；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;7)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;公然侮辱他人或者捏造事实诽谤他人的，或者进行其他恶意攻击的；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;8)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;损害国家机关信誉的；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;9)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;其他违反宪法和法律法规，或明显违反社会公德的；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、在接受团家政网服务的过程中，您不得从事下列行为：&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）发表、传送、传播、储存侵害他人知识产权、商业秘密权等合法权利的内容&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）传送或散布以其他方式实现传送的含有受到知识产权法律保护的图像、相片、软件或其他资料的文件，作为举例（但不限于此）：包括版权或商标权（或隐私权或公开权），除非用户拥有或控制着相应的权利或已得到所有必要的认可；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）使用任何包含有通过侵犯商标、版权、专利、商业机密或任何一方的其他专有权利的方式利用本&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;“&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;软件&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;”&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;获得的图像或相片的资料或信息；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）进行危害计算机网络安全的行为，包括但不限于：使用未经许可的数据或进入未经许可的服务器&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;/&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;帐号；未经允许进入公众计算机网络或者他人计算机系统并删除、修改、增加存储信息；未经许可，企图探查、扫描、测试本平台系统或网络的弱点或其它实施破坏网络安全的行为；企图干涉、破坏本平台系统或网站的正常运行，故意传播恶意程序或病毒以及其他破坏干扰正常网络信息服务的行为；伪造&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;TCP/IP&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;数据包名称或部分名称；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）修改或伪造软件作品运行中的指令、数据、数据包，增加、删减、变动软件的功能或运行效果，不得将用于上述用途的软件通过信息网络向公众传播或者运营；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;6&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）在未经团家政书面明确授权前提下，出售、出租、出借、散布、转移或转授权软件和服务或相关的链接或从使用软件和服务或软件和服务的条款中获利，无论以上使用是否为直接经济或金钱收益；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;7&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;违背团家政页面公布之活动规则，包括但不限于发布虚假信息、或制造虚假身份以误导、欺骗他人、作弊或通过其他手段进行虚假交易。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您了解并同意，团家政网有权应有权部门（包括司法及行政部门）的要求，向其提供您在团家政平台填写的注册信息和发布纪录等必要信息。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、在团家政平台上使用团家政服务过程中，您承诺遵守以下约定：&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;1)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;在使用团家政平台服务过程中实施的所有行为均遵守国家法律、法规等规范文件及团家政平台各项规则的规定和要求，不违背社会公共利益或公共道德，不损害他人的合法权益，不违反本协议及相关规则。您如果违反前述承诺，产生任何法律后果的，您应以自己的名义独立承担所有的法律责任，并确保团家政网免于因此产生任何损失或增加费用；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;不发布国家禁止发布的信息（除非取得合法且足够的许可），不发布涉嫌侵犯他人知识产权或其它合法权益的信息，不发布违背社会公共利益或公共道德、公序良俗的信息，不发布其它涉嫌违法或违反本协议及各类规则的信息；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;3)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;不对团家政平台上的任何数据作商业性利用，包括但不限于在未经团家政网事先书面同意的情况下，以复制、传播等任何方式使用团家政平台上展示的资料；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;4)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;不使用任何装置、软件或例行程序干预或试图干预团家政平台的正常运作或正在团家政平台上进行的任何活动。您不得采取任何将导致不合理的庞大数据负载加诸团家政平台网络设备的行动。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您了解并同意：&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;1)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;您违反上述承诺时，团家政网有权依据本声明的约定，做出相应处理或终止向您提供服务，且无须征得您的同意或提前通知于您；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;根据相关法令的指定或者团家政网服务规则的判断，您的行为涉嫌违反法律、法规的规定或违反本声明和规则的条款的，团家政网有权采取相应措施，包括但不限于直接屏蔽、删除侵权信息、降低您的信用值或直接停止提供服务；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;3)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;对于您在团家政平台上实施的行为，包括您未在团家政平台上实施但已经对团家政平台及其用户产生影响的行为，团家政网有权单方认定您行为的性质及是否构成对本声明或规则的违反，并据此采取相应的处理措施。您应自行保存与您行为有关的全部证据，并应对无法提供充分证据承担不利后果；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;4)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;对于您涉嫌违反承诺的行为对任意第三方造成损害的，您均应当以自己的名义独立承担所有的法律责任，并应确保团家政网免于承担因此产生的损失或增加的费用；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;5)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;如您涉嫌违反有关法律或者本声明之规定，使团家政网遭受任何损失，或受到任何第三方的索赔，或受到任何行政管理部门的处罚，您应当赔偿团家政网因此造成的损失及实际发生的费用，包括合理的律师费用。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:22.5000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;五、责任范围和责任限制&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、团家政网负责向您提供团家政平台服务，但对平台服务不作任何明示或暗示的保证，包括但不限于团家政平台服务的适用性、没有错误或疏漏、持续性、准确性、可靠性、适用于某一特定用途。同时，也不对团家政平台服务所涉及的技术及信息的有效性、准确性、正确性、可靠性、稳定性、完整性和及时性作出任何承诺和保证；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、团家政网仅向您提供团家政平台服务，您了解团家政平台上的信息系用户自行发布，由于海量信息的存在，且团家政平台无法杜绝可能存在风险和瑕疵。您应谨慎判断、确定相关信息的真实性、合法性和有效性，并注意保留相应的证据以利于维权，如可能，尽量采用网站建议的交易方式进行；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、团家政平台与其他的在线使用的互联网网站一样，也会受到各种不良信息、网络安全和网络故障问题的困扰，包括但不限于：&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）其他用户可能会发布诈骗或虚假信息，或者发表有谩骂、诅咒、诋毁、攻击内容的，或者含有淫秽、色情、下流、反动、煽动民族仇恨等让人反感、厌恶的内容的非法言论；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）其他用户可能会发布一些侵犯您或者其他第三方知识产权、肖像权、姓名权、名誉权、隐私权或其他合法权益的图片、照片、文字等资料；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）面临着诸如黑客攻击、计算机病毒困扰、系统崩溃、网络掉线、网速缓慢、程序漏洞等问题的困扰和威胁。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;您充分了解并同意：上述的各种不良信息、网络安全和网络故障问题，并不是团家政网所导致的问题，由此可能会造成物质与精神上的损害和损失，概由您自行承担，团家政网无须向您承担任何责任。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您同意，在发现本网站任何内容不符合法律规定，或不符合本用户声明规定的，您有义务及时通知团家政网。如果您发现您的个人信息被盗用、您的版权或者其他权利被侵害，请将此情况告知团家政网并同时提供如下信息和材料：&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;1)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;侵犯您权利的信息和网址、编号或其他可以找到该信息的细节；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;您是所述的版权或者其他权利的合法拥有者的权利证明；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;3)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;您的联系方式，包括联系人姓名、地址、电话号码和电子邮件；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;4)&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;您的身份证复印件、营业执照等其他相关资料。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;经审查得到证实的，我们将及时删除相关信息。我们仅接受邮寄、电子邮件或传真方式的书面侵权通知。情况紧急的，您可以通过客服电话先行告知，我们会视情况采取相应措施。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;5&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您了解并同意，团家政网不对因下述任一情况而导致您的任何损害赔偿承担责任，包括但不限于利润、商誉、使用、数据等方面的损失或其它无形损失的损害赔偿：&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;1) &lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;使用或未能使用团家政平台服务；&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2) &lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;第三方未经批准地使用您的账户或更改您的数据；&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;3) &lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;通过团家政平台服务购买或获取任何商品、样品、数据、信息等行为或替代行为产生的费用及损失；&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;4) &lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;您对团家政平台服务的误解；&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;5) &lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;任何非因团家政网的原因而引起的与团家政平台服务有关的其它损失。&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;6&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您在团家政网上使用第三方提供的产品或服务时，除遵守本声明约定外，还应遵守第三方的用户声明。团家政网和第三方对可能出现的纠纷在法律规定和约定的范围内各自承担责任。&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;7&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您同意在使用团家政平台服务过程中显示团家政网自行或由第三方服务商向您发送的推广或宣传信息（包括商业与非商业信息），其方式和范围可不经向您特别通知而变更。除法律法规明确规定外，您应自行对依该推广信息进行的交易负责，对用户因依该推广信息进行的交易或前述第三方服务商提供的内容而遭受的损失或损害，团家政网不承担任何责任。&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;8&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、团家政网对下列不可抗力行为免责：信息网络正常的设备维护、信息网络连接故障、电脑、通讯或其他系统的故障、电力故障、罢工、劳动争议、暴乱、起义、骚乱、生产力或生产资料不足、火灾、洪水、风暴、爆炸、战争、政府行为、司法行政机关的命令或第三方的不作为而造成的不能服务或延迟服务。&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;9&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您应当严格遵守本声明及团家政网发布的其他声明、活动规则，因您违反声明或规则的行为给第三方或团家政造成损失的，您应当承担全部责任。&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;10&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、团家政网保留在中华人民共和国大陆地区施行之法律允许的范围内独立决定拒绝服务、关闭用户账户、清除或编辑内容或取消订单的权利。&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:22.5000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;六、服务的终止&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您同意，团家政网基于平台服务的安全性，有权中止向您提供部分或全部团家政平台服务，暂时冻结您的账户，待安全问题解决后及时恢复，并对中止、冻结及恢复的事实及时通知。如果网站的安全问题是由于您的违法行为引起，团家政网有权终止向您提供部分或全部团家政平台服务，永久冻结（注销）您的帐户，并有权向您提出索赔。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您同意，团家政网对您的服务终止后，团家政网仍享有下列权利：&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;1) &lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;继续保存您未及时删除的注册信息及您使用团家政平台服务期间发布的所有信息至法律规定的记录保存期满。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）您在使用团家政平台服务期间存在违法行为或违反本声明或规则的行为的，团家政网仍可依据本协议向您主张权利、追究责任。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:22.5000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;七、隐私权政策&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、团家政网将在团家政平台公布并不时修订隐私权条款，隐私权条款是构成本声明的有效组成部分。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您知悉并认可：团家政网可能会与第三方合作向用户提供相关的网络服务，在此情况下，如团家政网旗下相应主体已与该第三方签署了适当的保密条款，则团家政网有权将用户的注册资料等提供给该第三方。另外，在不透露单个用户隐私资料的前提下，团家政网有权对整个用户数据库进行分析并对用户数据库进行商业上的利用。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、团家政网将运用各种安全技术和程序建立完善的管理制度来保护您的个人信息，以免遭受未经授权的访问、使用或披露。对此您表示理解和认同。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、团家政网不会将您的个人信息转移或披露给任何非关联的第三方，除非：&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）相关法律、法规或法院、政府机关要求；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）为完成合并、分立、收购或资产转让而转移；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;）为提供您要求的服务所必需。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您知悉并认可：团家政网通过推广或其他方式向您提供链接，使您可以接入第三方服务或网站。您使用该等第三方的服务时，须受该第三方的服务条款及隐私政策约束，您需要仔细阅读其条款。本声明仅适用于团家政网提供的服务器所收集的信息，并不适用于任何第三方提供的服务或第三方的信息使用规则，团家政网对任何第三方使用由您提供的信息不承担任何责任。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;6&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、您知悉并认可：为保护您的个人信息的安全，我们使用各种安全技术和程序来保护您的个人信息不被未经授权的访问、使用或泄漏。对此您表示理解和认同。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;7&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、团家政网不对用户所发布信息的删除或储存失败负责。团家政网并不承诺对用户的存储信息进行无限期保留。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:22.5000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;八、知识产权声明&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、团家政网所在公司及其关联公司的商标受法律保护，任何人不得擅自使用。凡侵犯本公司版权等知识产权的，团家政网将依法追究其相关法律责任。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、团家政平台所刊登的资料信息（包括但不限于编码、文字、图表、标识、按钮图标、图像、声音文件片段、数字下载、数据编辑和软件），均是团家政网或其内容提供者的财产，受中国和国际版权法的保护。本平台上所有内容的汇编是团家政网的排他财产，受中国和国际版权法的保护。本平台上所有软件都是团家政网或其关联公司或其软件供应商的财产，受中国和国际版权法的保护。任何被授权的浏览、复制、打印和传播属于团家政平台网站内信息内容都不得用于商业目的且所有信息内容及其任何部分的使用都必须包括此版权声明。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、本声明已经构成《中华人民共和国著作权法》第二十五条（条文序号依照&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;2011&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;年版著作权法确定）及相关法律规定的著作财产权等权利转让书面协议，其效力及于用户在团家政平台上发布的任何受著作权法保护的作品内容，无论该等内容形成于本声明发布前还是发布后。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;4&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、用户通过团家政平台发布的信息或内容，并不代表团家政网之意见及观点，也不意味着团家政网赞同其观点或证实其内容的真实性。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、用户通过团家政平台发布的信息、文字、图片等资料均由团家政网用户提供，其真实性、准确性和合法性由信息发布人负责。团家政不提供任何保证，并不承担任何法律责任。如果以上资料侵犯了第三方的知识产权或其他权利，责任由信息发布者本人承担，团家政网对此不承担责任。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9pt;&quot;&gt;6&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;、除法律另有强制性规定外，未经团家政网明确的特别书面许可，任何单位或个人不得以任何方式非法地全部或部分复制、传播、展示、镜像、上载、下载、转载、引用、链接、抓取或以其他方式使用本站的信息内容，否则，团家政网有权追究其法律责任。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:274.5000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;团家政网&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:252.0000pt;background:#FFFFFF;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;color:#333333;font-size:9pt;&quot;&gt;&lt;span&gt;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;二&lt;/span&gt;0一七年十月一日&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:#646464;font-size:9.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:9.0000pt;&quot;&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-indent:18.0pt;&quot;&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;', '3', '1', '1494905928');
INSERT INTO `pre_mall_article` VALUES ('4', '入驻声明', '&lt;p align=&quot;center&quot; style=&quot;text-align:center;&quot;&gt;\r\n	&lt;span style=&quot;font-size:14.0pt;font-family:宋体;&quot;&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:97pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:14pt;&quot;&gt;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 团家政网机构或个人商户入驻声明&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Calibri;font-size:14pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:18pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;&lt;span&gt;各机构或个人商户，在入驻、使用团家政网站和&lt;/span&gt;APP&lt;span&gt;之前，请您仔细阅读本声明的下述条款。您浏览、使用团家政网络平台资源，表示您已充分阅读、正确理解并完全接受本声明的全部条款。若您对下列各条款有任何疑问或异议，则请勿对本网站和&lt;/span&gt;&lt;span&gt;APP&lt;/span&gt;&lt;span&gt;进行任何形式的使用或利用。本声明对使用本网站和&lt;/span&gt;&lt;span&gt;APP&lt;/span&gt;&lt;span&gt;的一切用户（包括浏览本网站及相关网页的机构或个人商户、普通用户及注册用户）均具有约束力。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;&lt;span&gt;一：定义条款&lt;/span&gt; &lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;1.1&lt;span&gt;平台，特指由团家政网现在或将来拥有合格权限运营&lt;/span&gt;&lt;span&gt;/&lt;/span&gt;&lt;span&gt;管理的，提供入驻机构&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;&lt;span&gt;个人商户为雇主提供家政服务的&lt;/span&gt;“团家政”网络服务平台（以下统称为“平台”），包括但不限于团家政网关联方、合作方运营&lt;span&gt;/&lt;/span&gt;&lt;span&gt;管理的网络服务平台，及未来新合作的网络平台等；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;1.2&lt;span&gt;雇主：即在平台注册，并使用其本人注册的账户，通过平台展示信息获取服务的个人。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;1.3&lt;span&gt;入驻机构&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户信息：入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户通过平台发布的，在平台系统中展示的服务内容（如服务描述、服务人员概况、门店信息、优惠信息）等，该信息为入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户就前述服务向雇主发出的要约，一旦雇主通过平台确认同意购买该服务，即视为入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户与雇主达成了相应合同；&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;1.4&lt;span&gt;代收款项：平台代入驻机构&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户收取的，雇主通过平台向入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户支付的服务人员工资、服务费等；&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;1.5&lt;span&gt;平台佣金：平台为入驻机构&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户提供服务收取的相关费用。&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;二、服务内容&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;为实现入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户进入平台开展经营活动、通过平台发布服务信息、与雇主进行交易之目的。平台为入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户提供授权许可计算机软件及软件技术服务、网络技术服务及其他相关服务，具体服务内容如下：&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;2.1 &lt;span&gt;平台技术服务&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;平台为入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;&lt;span&gt;个人商户提供&lt;/span&gt;“团家政”系统平台以实现入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户在线展示、交易服务，并代入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户收取雇主在线交易所对应的服务人员工资、服务费等；&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;2.2&lt;span&gt;授权许可入驻机构&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户使用平台所有合法运营、管理的与合作内容相关的计算机软件，并提供软件技术支持；&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;2.3&lt;span&gt;平台以自有技术、知识为入驻机构&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户解决其在平台经营过程中遇到的网络技术问题。为拓展入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户知名度、提高交易量，平台可根据市场需求，不断优化双方合作涉及的系统及软、硬件，并开展多种多样的服务功能，入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户可通过平台选择增加、完善、提高相应功能；&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;2.4&lt;span&gt;该类功能包括但不限于：服务的在线预约功能、入驻机构&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户旗下服务人员管理功能、为入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户及雇主提供在线点评功能，具体以入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户在平台确认功能为准；&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;2.5&lt;span&gt;平台将对入驻机构&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户就上述功能的操作及使用进行培训指导，并提供技术支持。&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;三、平台佣金收取标准及收取方式&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;平台向入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户收取佣金的标准由双方在入驻前商定，由平台从代收款项中扣收。&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;四、入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户权利义务&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;4.1&lt;span&gt;入驻机构&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户应遵守本声明之约定及平台公告发布的履行本声明项下义务相关的各项规则；&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;4.2&lt;span&gt;入驻机构&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户应保证其为一家根据中国法律合法成立并有效存续的法人和其他商事主体或个人；同时入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;&lt;span&gt;个人商户应当提供盖章的资质证明复印件及商品服务的展示资料等，如涉及特殊行业需要特定的资质或许可文件等的，也应予以提供，前述资料包括但不限于营业执照、行政许可文件、商品&lt;/span&gt;/&lt;span&gt;服务说明、信息文案所需资料（包含图片、说明、门店、商家介绍）等。入驻机构&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户&lt;/span&gt;&lt;u&gt;&lt;span style=&quot;font-family:宋体;font-size:12pt;&quot;&gt;因资质或提供的信息问题而致使经营活动无法正常进行的，由此产生的一切结果由&lt;/span&gt;&lt;/u&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户&lt;/span&gt;&lt;u&gt;&lt;span style=&quot;font-family:宋体;font-size:12pt;&quot;&gt;负责并赔偿平台因此遭受的损失；&lt;/span&gt;&lt;/u&gt;&lt;u&gt;&lt;span style=&quot;font-family:Calibri;font-size:12pt;&quot;&gt;&lt;/span&gt;&lt;/u&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;4.3&lt;span&gt;入驻机构&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;&lt;span&gt;个人商户应按照约定、页面信息及平台方规则向雇主提供服务，否则由此引起雇主投诉或给雇主&lt;/span&gt;/&lt;span&gt;平台造成损失的，相应责任均由入驻机构&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户承担，且平台有权解除合作并要求入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户支付违约金；&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;4.4&lt;span&gt;入驻机构&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户应合法经营，且提供的服务应符合国家法律、法规，规章的规定。如因入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户行为或入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户派遣的服务人员，造成雇主及其他民事主体财产损失、人身伤害、精神损害的，由甲方及其所派遣的服务人员承担一切赔偿和法律责任，平台有权视情况暂停与入驻机构&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户的合作，直至该事件解决；&lt;/span&gt;&lt;u&gt;&lt;span style=&quot;font-family:Calibri;font-size:12pt;&quot;&gt;&lt;/span&gt;&lt;/u&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;4.5&lt;span&gt;入驻机构&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;或&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;个人商户应保证合作期间经营场所内实际消费价格不低于平台价，且不得协助、诱使、接受雇主改为使用现金等线下交易，否则平台有权立即终止合作并要求入驻机构或个人商户承担违约责任；&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;4.6&lt;span&gt;入驻机构或个人商户承诺并保证使用的其他商品、商标、品牌、图片等享有合法权或合法授权，不会侵犯他人的知识产权、企业名称权等权益，承诺不会因展示上述信息而遭受来自第三方的任何投诉、抗辩及争议，否则相应责任均由入驻机构或个人商户承担并应赔偿平台因此而遭受的损失。入驻机构或个人商户承诺在有第三方就展示上述信息向平台提出知识产权等主张时，平台有权视情况删除或屏蔽该信息，直至有关机关对此作出生效认定时止；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;4.7&lt;span&gt;如平台在合作过程中提供了相应设备、设施给入驻机构或个人商户使用，入驻机构或个人商户确认前述设备的所有权属于平台，入驻机构或个人商户仅有使用权并应尽到妥善保管义务，且基于前述设备的使用按平台要求向其提供相应数据，在合作终止时，应将相应设备、设施返还给平台。因入驻机构或个人商户原因造成的设备损失、丢失，入驻机构或个人商户应进行相应赔偿（具体价格双方可选择采用书面、邮件或平台操作任一种方式确认）；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;4.8&lt;span&gt;无论因任何原因终止合作，入驻机构或个人商户承诺立即停止以任何方式使用平台相关的商标、标识、网络名称、网站内容等；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;4.9&lt;span&gt;入驻机构或个人商户同意雇主通过平台发布的针对入驻机构或个人商户的评论、照片等纯属雇主个人意见，与平台立场无关，平台不承担任何责任；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;4.10&lt;span&gt;入驻机构或个人商户不得通过任何手段、以任何方式自行或者委托他人进行如下行为：包括但不限于虚拟交易、虚拟验证、自买自卖、伪造网络用户真实消费、体验、刷单等违反平台规则、损害平台利益的行为；或伪造、仿冒等其他违反国家法律法规的行为；或其它违反公平竞争诚信原则与商业道德的行为；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;4.11 &lt;span&gt;如在合作期限内，因入驻机构或个人商户原因造成的方案、项目或合作终止（包括但不限于服务方案已下线或停止营业），入驻机构或个人商户应及时通知平台。如因入驻机构或个人商户怠于通知造成的一切纠纷和责任（包括但不限于雇主投诉、行政机关处罚等）由入驻机构或个人商户承担，由此给平台造成经济损失的，入驻机构或个人商户应进行赔偿；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;4.12&lt;span&gt;入驻机构或个人商户服务人员与雇主之间发生的任何矛盾与纠纷，均由入驻机构或个人商户负责解决，平台可提供一定的协助，但最终处理结果与平台无关；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:24pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;五、平台权利义务&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;5.1 &lt;span&gt;平台应向入驻机构或个人商户提供本相应的技术服务及其他相关服务；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;5.2 &lt;span&gt;为更好的推荐入驻机构或个人商户的服务，以提升知名度&lt;/span&gt;&lt;span&gt;/&lt;/span&gt;&lt;span&gt;订单量，平台可通过适当的方式和渠道做相关宣传介绍，并进行相关推荐&lt;/span&gt;&lt;span&gt;/&lt;/span&gt;&lt;span&gt;推广。入驻机构或个人商户对上述行为予以认可，并授权平台&lt;/span&gt;&lt;span&gt;/&lt;/span&gt;&lt;span&gt;平台关联方&lt;/span&gt;&lt;span&gt;/&lt;/span&gt;&lt;span&gt;平台合作方就入驻机构或个人商户及其相关门店的名称、&lt;/span&gt;&lt;span&gt;LOGO&lt;/span&gt;&lt;span&gt;、图片、文字、门店、会员优惠等信息进行使用；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;5.3 &lt;span&gt;平台有权对入驻机构或个人商户拟在平台发布的内容、信息进行形式审核，必要时平台有权依据法律、法规、政策规定及平台规则予以删改或拒绝发布；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;5.4 &lt;span&gt;除展示信息内容或文字确有错误、展示信息需更新外，入驻机构或个人商户不得要求平台修改已发布于平台上的信息；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;5.5 &lt;span&gt;如雇主就入驻机构或个人商户服务向平台投诉，平台经核实后，有权要求入驻机构或个人商户及时解决；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;5.6 &lt;span&gt;平台有权升级更新平台系统，如有变更，平台将通过前述系统以公告形式作出通知。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;六、违约责任&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;6.1&lt;span&gt;如入驻机构或个人商户违反诚信原则，或违反声明的任一条款或平台上的任何规则，或提供的资源、证照等信息不属实，则平台有权停止向其支付代收款项，并有权要求其在一定期限内纠正违约行为。如入驻机构或个人商户在平台要求的期限内拒接纠正或纠正后仍不符合规定的，平台有权单方面解除合作；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;6.2 &lt;span&gt;因平台未能按照声明履行义务，包括未及时付款，且在入驻机构或个人商户要求的期限内拒绝纠正或纠正后仍不符合规定的，平台应承担因此给入驻机构或个人商户造成的损失。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;七、保密义务&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;合作双方均应对其获得的对方之业务、经营、财务状况和其他资料予以严格保密，不得以任何形式向任何第三方披露。否则，因此给对方造成任何损失的，违约方应承担全部责任。保密义务在合作有效期间及终止后始终有效，不因合作其他条款整体或部分无效、被撤销而失效。&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;八、合作终止和解除&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;本声明约定的终止情形发生时合作终止。或一方经书面通知对方，且经双方协商一致后，可解除合作。&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;8.1 &lt;span&gt;平台有权删除入驻机构或个人商户已发布的信息，且有权拒绝提供相关信息；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;8.2&lt;span&gt;合作终止前入驻机构或个人商户已与雇主达成的尚未履行完毕的订单，入驻机构或个人商户应按照合同约定继续履行相应义务；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;8.3&lt;span&gt;入驻机构或个人商户同意平台保存有关资质信息、服务信息等相关资料。&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;九、免责条款&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt; &lt;/span&gt;&lt;b&gt;&lt;span style=&quot;font-family:Calibri;font-size:12pt;&quot;&gt; &lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:宋体;font-size:12pt;&quot;&gt;因战争、自然灾害、政府行为、互联网系统故障、互联网通讯提供商故障等不可抗拒因素或第三方原因导致平台不能履行义务，平台无须承担责任。&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:Calibri;font-size:12pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;十、法律适用及争议解决条款&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;10.1 &lt;span&gt;本声明的成立、有效性、解释、履行、签署、修订和终止以及争议的解决均应适用中华人民共和国法律；&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:23.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;10.2 &lt;span&gt;因合作引起的有关争议，双方应协商解决。&lt;/span&gt;&lt;/span&gt;&lt;u&gt;&lt;span style=&quot;font-family:宋体;font-size:12pt;&quot;&gt;协商不成的，任何一方均可将争议提交至原告方所在地法院。&lt;/span&gt;&lt;/u&gt;&lt;u&gt;&lt;span style=&quot;font-family:Calibri;font-size:12pt;&quot;&gt;&lt;/span&gt;&lt;/u&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:317.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:317.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:317.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:317.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:317.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:230.4pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;团家政网&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;text-indent:198pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;font-size:12.0000pt;&quot;&gt;&lt;span&gt;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;二&lt;/span&gt;0&lt;span&gt;一七年十月一日&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Calibri;font-size:12.0000pt;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;text-align:left;&quot;&gt;\r\n	&lt;span style=&quot;font-family:Calibri;font-size:10.5000pt;&quot;&gt; &lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:14.0pt;font-family:宋体;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;font-size:10.5pt;font-family:;&quot; &quot;=&quot;&quot;&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span&gt; &lt;/span&gt; \r\n&lt;/p&gt;', '4', '1', '1494905949');
