INSERT INTO `pre_mall_nurse` VALUES ('45', '70', '15162110663', '', '', '', '', '0', '张革新', '', 'data/nurse/201705/26/144654hx9dk6x1oogvk6dk.jpg', '0', '3', '', '4000', '0', '26', '59', '2', '', '0', '0', '', '', '10', '162', '1250', '江苏省徐州市沛县', '徐州', '10', '160', '1225', '南京', '', '江苏省南京市下关区', '下关区', '', '', '', '', '', '', 'a:1:{i:0;s:2:\"jk\";}', 'a:1:{i:0;s:47:\"data/nurse/201705/26/163042y8st8jjbj2t8db28.jpg\";}', '请致电本人详谈后，再点预约', '', '照顾老人，自理不自理都可以。做饭打扫卫生', '', '本人一米七零，身体健康不抽烟不酗酒，不打牌，不赌博，无一切不良嗜好和恶习！懂得养生，有一定的医疗基础，和养生经验，拔罐按摩和利用中药穴位 外敷，贴脐，泡脚疗法，调理和康复颈椎病，腰椎病，骨刺，痔疮等疾病！纯属偏方，验方！虽难登医学大雅之堂，但属祖辈传方确很有奇效！因此想通过护理工作帮助身心不适的朋友恢复健康！我愿做你的知心朋友和呵护健康的使者！负责你的安全及日常护理！达到健康长寿的目标！做良心人！干良心事！积德行善无愧于心！望识有缘人！', '1', '0', '0.00', '0.00', '0.00', '0.00', '2', '0', '0', '0', '0', '0.00', '0.00', '0.00', '0.00', '0', '0', '1', '0', '0', '0', '1495781730', '0', '0', '0', '0', '0', '0', '0000-00-00 00:00:00');
